  [],\n\t\"revision_timestamp\": \"2015-07-08T19:22:14.958432\",\n\t\"name\": \"sorce-xps-level-3-solar-spectral-irradiance-daily-means-v010\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The SORCE XUV Photometer System (XPS) Solar
  Spectral Irradiance (SSI) Daily Data Product SOR3XPSD contains solar XUV irradiances
  in the 0.1 to 27 nm range, as well as Lyman-alpha, in broad bands (7-10 nm resolution)
  as listed below:nn Diode  1:   0.1 -   7.0 nmn Diode  2:   0.1 -   7.0 nmn Diode
  \ 3:  17.0 -  23.0 nmn Diode  6:   0.1 -  11.0 nmn Diode  7:   0.1 -   7.0 nmn Diode
  \ 9:   0.1 -   7.0 nmn Diode 11: 121.0 - 122.0 nmnnThe data are reported at a mean
  solar distance of 1 AU and zero relative line-of-sight velocity with respect to
  the Sun. The accuracy for the XPS Level 3 irradiance is 12-30%, photometer dependent,
  and the long-term repeatability is 1%/year.nnThe SOR3XPSD data are arranged in a
  single tabular ASCII text file which can be easily read into a spreadsheet application.
  The columns contain the date, Julian day, average measurement date, standard deviation
  of measurement date, diode number, minimum wavelength, maximum wavelength, instrument
  mode, data version number, median irradiance, mean irradiance, absolute uncertainty,
  measurement precision, calculation precision, degradation model, degradation version,
  and number of data points. The rows are arranged with data for each day, repeating
  for each diode wavelength.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
